import React, { useEffect, useState } from 'react';
import { api } from '../services/api';
import '../styles/AppAdminPanel.css';

function AppAdminPanel() {
  const [assignedApps, setAssignedApps] = useState([]);
  const [users, setUsers] = useState([]);
  const [roles, setRoles] = useState([]);
  const [selectedApp, setSelectedApp] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);

  useEffect(() => {
    fetchAssignedApps();
    fetchUsers();
    fetchRoles();
  }, []);

  const fetchAssignedApps = async () => {
    try {
      const data = await api.getAppAdminApplications();
      setAssignedApps(data);
      setLoading(false);
    } catch (err) {
      setError('Failed to fetch assigned applications');
      setLoading(false);
    }
  };

  const fetchUsers = async () => {
    try {
      const data = await api.getUsers();
      setUsers(data);
    } catch (err) {
      setError('Failed to fetch users');
    }
  };

  const fetchRoles = async () => {
    try {
      const data = await api.getRoles();
      setRoles(data);
    } catch (err) {
      setError('Failed to fetch roles');
    }
  };

  const handleAddRole = async (appId, roleName) => {
    try {
      await api.createRole({ role_name: roleName, app_id: appId });
      setSuccess('Role added successfully');
      fetchRoles();
    } catch (err) {
      setError('Failed to add role');
    }
  };

  const handleAssignUser = async (userId, appId, roleId) => {
    try {
      await api.assignUserToApplication(userId, appId, roleId);
      setSuccess('User assigned successfully');
    } catch (err) {
      setError('Failed to assign user');
    }
  };

  if (loading) return <div className="loading">Loading...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="app-admin-panel">
      <h3>Application Administration</h3>

      {success && <div className="success-message">{success}</div>}

      <div className="assigned-apps">
        <h4>Your Assigned Applications</h4>
        <div className="apps-list">
          {assignedApps.map(app => (
            <div 
              key={app.app_id} 
              className={`app-card ${selectedApp === app.app_id ? 'selected' : ''}`}
              onClick={() => setSelectedApp(app.app_id)}
            >
              <h5>{app.app_name}</h5>
              <p>{app.description}</p>
            </div>
          ))}
        </div>
      </div>

      {selectedApp && (
        <div className="app-management">
          <div className="role-management">
            <h4>Manage Roles</h4>
            <div className="add-role-form">
              <input
                type="text"
                placeholder="New Role Name"
                onKeyPress={(e) => {
                  if (e.key === 'Enter') {
                    handleAddRole(selectedApp, e.target.value);
                    e.target.value = '';
                  }
                }}
              />
            </div>
            <div className="roles-list">
              {roles.filter(role => role.app_id === selectedApp).map(role => (
                <div key={role.role_id} className="role-item">
                  <span>{role.role_name}</span>
                </div>
              ))}
            </div>
          </div>

          <div className="user-assignment">
            <h4>Assign Users</h4>
            <div className="user-list">
              {users.map(user => (
                <div key={user.user_id} className="user-item">
                  <span>{user.username}</span>
                  <select
                    onChange={(e) => {
                      const roleId = e.target.value;
                      if (roleId) {
                        handleAssignUser(user.user_id, selectedApp, roleId);
                      }
                    }}
                    defaultValue=""
                  >
                    <option value="" disabled>Select Role</option>
                    {roles
                      .filter(role => role.app_id === selectedApp)
                      .map(role => (
                        <option key={role.role_id} value={role.role_id}>
                          {role.role_name}
                        </option>
                      ))}
                  </select>
                </div>
              ))}
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default AppAdminPanel;
